delay:
	push ax
	push cx
	push dx

	mov cx, 0fh
	mov ah, 86h
	mov dx, 4240h
	int 15h

	pop dx
	pop cx
	pop ax
	ret

convert_to_ascii:
	push ax
	push dx
	push bx

	mov bx, 10
	xor dx, dx

	div bx
	add dl, 0x30
	mov [digit2], dl

	add al, 0x30
	mov [digit1], al

	pop bx
	pop dx
	pop ax
	ret

default_cursor_position:
	push ax
	push bx
	push dx

	mov ah, 02h
	mov bh, 0
	mov dl, 69
	mov dh, 12
	int 10h

	pop dx
	pop bx
	pop ax
	ret

minute_cursor_position:
	push ax
