	pop ax
	ret

drawHorizontal:
	PUSH bp
	MOV BP, SP
	pusha
	mov ah, 0X0C
	mov al, 0x0f
	mov bh, 0
	MOV DI, 10

	mov DX, [bp+4] ;Y
	OUTERLOOP:
		mov CX, [bp+6] ;X
		MOV SI, [BP+8] ;length
		ADD SI, CX

	LP:
	int 10h
	INC CX
	CMP CX, SI
	JNE LP

	ADD DX, 40 ; INCREMENTING Y FOR ANOTHER LINE
	DEC di
	JNZ OUTERLOOP

	popa
	POP BP
	ret 6

DRAWVERTICAL:

	PUSH bp
	MOV BP, SP
	pusha
	mov ah, 0X0C
	mov al, 0x0f
	mov bh, 0
	mov CX, [bp+6] ;X
	MOV DI, 10

	OUTERLOOP2:

	mov DX, [bp+4] ;Y
	MOV SI, [BP+8] ;length
	ADD SI, DX

	LPE:
	int 10h
	INC DX
	CMP DX, SI
	JNE LPE

	ADD CX, 40
	DEC di
	JNZ OUTERLOOP2

	popa
	POP BP
	RET 6

Print32x16:
    push bp
    mov bp, sp
    pusha
    
	mov di, 0
    mov cx, [bp + 4]   ; X 
    mov dx, [bp + 6]   ; Y 
    mov si, 0          

	incrementInRow:
		mov al, [num00 + si] 
		mov bl, 8            
	checkPixel:
		shr al, 1            
		jnc skipThisPixel    
		call plotThePixel    

	skipThisPixel:
		inc cx               
		dec bl               
		jnz checkPixel       

		inc si               
		cmp si, 64        
		jge nextBox             

		; after  4 bytes reset X and move to the next row
		test si, 3
		jnz incrementInRow   

		;mov cx, [bp + 4] 
		sub cx, 32      ;cx comes back to start the next row
		inc dx               
		cmp dx, 490       
		jl incrementInRow    

	nextBox:
		inc di
		xor si, si
		add cx, 8
		cmp cx, 478
		jl resetY

		;xor di, di
		mov cx, [bp + 4]
		add dx, 25
		cmp dx, 464
		jle incrementInRow

		resetY:
			;mov dx, [bp + 6]

			sub dx, 15    ;should be 16 workin on 15, jugaaar

			;cmp dx, 
			cmp di, 81
			jnz incrementInRow

			poop:
			popa
			pop bp
			ret 6

	plotThePixel:
		push ax
		push bx

		mov ah, 0x0C         
		mov al, 0x0F         
		mov bh, 0            
		int 10h

		pop bx
		pop ax
		ret

